import ProtectedDatabseRoute from './ProtectedDatabaseRoute';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Home />} />
        <Route path ='*' element={<Navigate to='/' />} />
        <Route path ='/db' element={<ProtectedDatabseRoute />} />
